import React from 'react'
import { useParams } from 'react-router-dom'
import Login from '../Login';

const Error = () => {
   const {errorMessage} = useParams();
  return (
    <div>
       <h6>{`No valid ${errorMessage}` }</h6>
        <Login/>
    </div>
  )
}

export default Error
